import React from "react";

const CountDownOne = () => {
      return (
        <>
          <div className="banner-countdown-wrap">            
            <span>22+</span><p>Clientes Satisfeitos</p>          

            <span>27k+</span><p>Linhas de código</p>          

            <span>154K+</span><p>Chícaras de café</p>          

            <span>45+</span><p>Projetos entregues</p>
          </div>
        </>
      );
  };

export default CountDownOne;
